def get_total_number_of_sequences(m, n):
    T = [[0 for _ in range(n + 1)] for _ in range(m + 1)] 
    for i in range(m + 1): 
        for j in range(n + 1): 
            if i == 0 or j == 0: 
                T[i][j] = 0
            elif i < j: 
                T[i][j] = 0
            elif j == 1: 
                T[i][j] = i 
            else: 
                T[i][j] = T[i-1][j] + T[i//3][j-1]  
    return T[m][n] if m > 0 and n > 0 else 0

